import React from "react";
import { StyleSheet, Text, View, Button, Image, TextInput } from "react-native";
import colors from "../../config/colors";
import ProviderCard from "../../ProviderCard";
import { Path as SvgPath } from "react-native-svg";
import Svg from "react-native-svg";
import svg from "../../config/svg";

const ClientBrowse = ({ navigation }, { props }) => {
  return (
    <View style={styles.layout}>
      <View style={styles.searchbar}>
      <TextInput
        style={styles.inputBox}
        onChangeText={(email) => setEmail(email)}
        placeholder="Search Providers"
        placeholderTextColor={colors.text_holder}
        autoCapitalize="none"
        keyboardType="email-address"
        returnKeyType="next"
        onSubmitEditing={() =>
          passwordInputRef.current && passwordInputRef.current.focus()
        }
        color={colors.black}
      />
      </View>
      <View style={styles.container}>
        <Image
          style={styles.image}
          source={require("../../../assets/splashimage.jpg")}
        />
        <View style={styles.textcontainer}>
          <Text style={styles.name}>Fatima Medlij</Text>
          <Text style={styles.category}>Category</Text>
          <Text style={styles.location}>Location</Text>
        </View>
        <View style={styles.ratingcontainer}>
          <Svg
            style={styles.star}
            fill={colors.myyellow}
            strokeWidth="30"
            stroke={colors.black}
            preserveAspectRatio="none"
            viewBox="0 0 612 792"
          >
            <SvgPath d={svg.star_svg} />
          </Svg>
          <Text style={styles.rating}>4.3</Text>
        </View>
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  image: {
    borderRadius: 50,
    width: 100,
    height: 100,
    borderWidth: 2,
    borderColor: colors.dark_grey,
  },
  category: {
    fontSize: 15,
    marginBottom: 8,
  },
  container: {
    backgroundColor: colors.babyblue,
    flexDirection: "row",
    width: "100%",
    flex: 1,
    padding: 20,
  },
  inputBox: {
    width: "80%",
    backgroundColor: colors.white,
    borderWidth: 1,
    borderColor: colors.black,
    paddingHorizontal: 16,
    fontSize: 16,
    color: colors.white,
    marginVertical: 10,
    height: 50,
    marginBottom: 20,
    color: colors.black,
  },
  layout: {
    alignContent: "center",
    padding: 20,
  },
  location: {
    fontSize: 15,
  },
  name: {
    fontSize: 20,
    fontWeight: 700,
    marginBottom: 8,
  },
  textcontainer: {
    flexDirection: "column",
    padding: 20,
    flex: 0.5,
    justifyContent: "flex-start",
  },
  rating: {
    padding: 10,
    fontSize: 20,
    fontWeight: "bold",
  },
  ratingcontainer: {
    alignContent: "flex-end",
    flexDirection: "row-reverse",
    justifyContent: "flex-end",
  },
  searchbar:{
    flexDirection: "row",
    width: "100%",
    flex: 1,
  },
  star: {
    width: 25,
    height: 30,
    padding: 5,
  },
});
export default ClientBrowse;
